import React from 'react';
import { Grid } from '@mui/material';
import { FaFacebook, FaTwitter, FaLinkedin } from 'react-icons/fa';

const Footer = () => {
  const footerStyle = {
    backgroundColor: '#333',
    color: '#fff',
    padding: '20px 0',
    textAlign: 'center',
  };

  const footerContentStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  };

  const footerLinksStyle = {
    display: 'flex',
    justifyContent: 'center',
    margin: '10px 0',
    gap: '15px',
  };

  const footerLinkStyle = {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '14px',
  };

  const footerSocialStyle = {
    display: 'flex',
    justifyContent: 'center',
    gap: '10px',
    marginTop: '10px',
  };

  const socialIconStyle = {
    fontSize: '20px',
    color: '#fff',
    cursor: 'pointer',
    transition: 'color 0.3s',
  };

  const footerBottomStyle = {
    marginTop: '10px',
    fontSize: '12px',
    color: '#aaa',
  };

  return (
    <footer style={footerStyle}>
      <Grid container spacing={3}>
        <Grid item xs={12} md={3}></Grid>

        <Grid item xs={12} md={6}>
          <div style={footerContentStyle}>
            <div style={footerLinksStyle}>
              <a href="/about-us" style={footerLinkStyle}>
                About Us
              </a>
              <a href="/contact" style={footerLinkStyle}>
                Contact
              </a>
              <a href="/privacy-policy" style={footerLinkStyle}>
                Privacy Policy
              </a>
              <a href="/terms" style={footerLinkStyle}>
                Terms of Service
              </a>
            </div>
            <div style={footerSocialStyle}>
              <a
                href="https://facebook.com"
                target="_blank"
                rel="noopener noreferrer"
                style={socialIconStyle}
              >
                <FaFacebook style={socialIconStyle} />
              </a>
              <a
                href="https://twitter.com"
                target="_blank"
                rel="noopener noreferrer"
                style={socialIconStyle}
              >
                <FaTwitter style={socialIconStyle} />
              </a>
              <a
                href="https://linkedin.com"
                target="_blank"
                rel="noopener noreferrer"
                style={socialIconStyle}
              >
                <FaLinkedin style={socialIconStyle} />
              </a>
            </div>
          </div>
        </Grid>

        <Grid item xs={12} md={3}>
          <div style={footerBottomStyle}>
            <p>&copy; 2024 CareerGuidance. All Rights Reserved.</p>
          </div>
        </Grid>
      </Grid>
    </footer>
  );
};

export default Footer;
